import React from "react";

export default function dummy(){
    return(
        <div id="banner">

            <div className="slider" onClick={Left}><img src={left} /></div>

           <div id="banner-text">
           <a>{props.name}</a>
            <p>{props.description}</p>
            </div> 

            <div id="banner-img">
                <img src={props.img} />
            </div>

            <div className="slider" onClick={Right}><img src={right} /></div>

        </div>
    )
}
